0258._Add_Digits.html.body:
258. Add Digits
难度: Easy
刷题内容

原题连接


https://leetcode.com/problems/add-digits


内容描述

Given a non-negative integer num, repeatedly add all its digits until the result has only one digit.

Example:

Input: 38
Output: 2 
Explanation: The process is like: 3 + 8 = 11, 1 + 1 = 2. 
             Since 2 has only one digit, return it.

Follow up:
Could you do it without any loop/recursion in O(1) runtime?
解题方案

思路 1
**- 时间复杂度: O(1)**- 空间复杂度: O(1)**


原理：
假设输入的数字是一个5位数字num，则num的各位分别为a、b、c、d、e 
有如下关系：num = a  10000 + b  1000 + c  100 + d  10 + e
即：num = (a + b + c + d + e) + (a  9999 + b  999 + c  99 + d  9)  
因为 a  9999 + b  999 + c  99 + d  9 一定可以被9整除，因此num模除9的结果与 a + b + c + d + e 模除9的结果是一样的。
对数字 a + b + c + d + e 反复执行同类操作，最后的结果就是一个 1-9 的数字加上一串数字，最左边的数字是 1-9 之间的，右侧的数字永远都是可以被9整除的。
这道题最后的目标，就是不断将各位相加，相加到最后，当结果小于10时返回。因为最后结果在1-9之间，得到9之后将不会再对各位进行相加，因此不会出现结果为0的情况。
因为 (x + y) % z = (x % z + y % z) % z，又因为 x % z % z = x % z，因此结果为 (num - 1) % 9 + 1，只模除9一次，并将模除后的结果加一返回。

代码：
/**
 * @param {number} num
 * @return {number}
 */
var addDigits = function(num) {
    if(num==0)
        return num;
    if(num%9==0)
        return 9;
    else return num%9;
};



